import React from 'react';
import { useNavigate } from 'react-router-dom';
import './CTA.css';

const CTA = () => {
  const navigate = useNavigate();

  const handleGetStarted = () => {
    navigate('/register');
  };

  return (
    <section className="cta-section">
      <div className="container">
        <h2 className="cta-title">Ready to Transform Your Society Management?</h2>
        <p className="cta-subtitle">Join hundreds of residential societies already using LivingLink</p>
        <div className="cta-buttons">
          <button className="btn btn-light btn-lg" onClick={handleGetStarted}>
            Get Started
          </button>
        </div>
      </div>
    </section>
  );
};

export default CTA;
